// @flow
import React from 'react';
import { ProgressBar, Colors } from 'class101-ui';

type Props = {
  /** 바의 길이 */
  percent: number,

  /** 배경 색상 */
  backgroundColor?: string,

  /** 바의 색상 */
  barColor?: string,

  /** 세로 높이 */
  height?: number,
};

const Component = ({
  percent,
  backgroundColor = Colors.gray200,
  barColor = Colors.orange600,
  height = 4,
}: Props) => (
  <ProgressBar
    percent={ percent }
    backgroundColor={ backgroundColor }
    barColor={ barColor }
    height={ height }
  />
);

export default Component;
